import React, { useState, useEffect, useMemo } from 'react';

function ViewRegistration({ setNotificationMessage }) {
  const [companyDetails, setCompanyDetails] = useState(null);
  const [companies, setCompanies] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');
  const [selectedIndustry, setSelectedIndustry] = useState('');
  const [industryOptions, setIndustryOptions] = useState([]);

  const loadPendingCompanies = () => {
    try {
      const all = JSON.parse(sessionStorage.getItem('companies')) || [];
      const pending = all.filter(c => c.isAccepted === false);
      setCompanies(pending);
      setIndustryOptions([...new Set(pending.map(c => c.industry))]);
    } catch (err) {
      console.error("Error loading companies:", err);
    }
  };

  useEffect(() => {
    loadPendingCompanies();
    const handleStorageChange = (e) => {
      if (e.key === 'companies') loadPendingCompanies();
    };
    window.addEventListener('storage', handleStorageChange);
    return () => window.removeEventListener('storage', handleStorageChange);
  }, []);

  const handleAccept = () => {
    if (!companyDetails) return;
    const all = JSON.parse(sessionStorage.getItem('companies')) || [];
    const updated = all.map(c => c.companyEmail === companyDetails.companyEmail ? { ...c, isAccepted: true, hasNotification: true } : c);
    sessionStorage.setItem('companies', JSON.stringify(updated));
    setNotificationMessage?.(`Registration for ${companyDetails.companyName} accepted.`);
    setCompanyDetails(null);
    loadPendingCompanies();
  };

  const handleReject = () => {
    if (!companyDetails) return;
    const all = JSON.parse(sessionStorage.getItem('companies')) || [];
    const updated = all.filter(c => c.companyEmail !== companyDetails.companyEmail);
    sessionStorage.setItem('companies', JSON.stringify(updated));
    setNotificationMessage?.(`Registration for ${companyDetails.companyName} rejected.`);
    setCompanyDetails(null);
    loadPendingCompanies();
  };

  const handleDownloadDocument = (document) => {
    const link = document.createElement('a');
    link.href = document.dataUrl;
    link.download = document.name;
    link.click();
  };

  const filtered = useMemo(() =>
    companies.filter(c =>
      c.companyName.toLowerCase().includes(searchQuery.toLowerCase()) &&
      (!selectedIndustry || c.industry === selectedIndustry)
    ),
    [companies, searchQuery, selectedIndustry]
  );

  return (
    <div>
      <h1>Pending Company Registrations</h1>
      <input placeholder="Search..." value={searchQuery} onChange={e => setSearchQuery(e.target.value)} />
      <select value={selectedIndustry} onChange={e => setSelectedIndustry(e.target.value)}>
        <option value="">All Industries</option>
        {industryOptions.map((ind, i) => <option key={i} value={ind}>{ind}</option>)}
      </select>

      {filtered.length ? filtered.map(c => (
        <div key={c.companyEmail}>
          <button onClick={() => setCompanyDetails(c)}>
            {c.companyLogo && <img src={c.companyLogo} alt="logo" style={{ width: 30, height: 30 }} />}
            {c.companyName}
          </button>
        </div>
      )) : <p>No pending registrations.</p>}

      {companyDetails && (
        <div style={{ position: 'fixed', right: 0, top: 0, width: 350, height: '100vh', background: '#f9f9f9', padding: 20 }}>
          <button onClick={() => setCompanyDetails(null)}>Close</button>
          <h3>{companyDetails.companyName}</h3>
          <p><strong>Industry:</strong> {companyDetails.industry}</p>
          <p><strong>Size:</strong> {companyDetails.companySize}</p>
          <p><strong>Email:</strong> {companyDetails.companyEmail}</p>
          {companyDetails.document && <button onClick={() => handleDownloadDocument(companyDetails.document)}>Download Document</button>}
          <button onClick={handleAccept}>Accept</button>
          <button onClick={handleReject}>Reject</button>
        </div>
      )}
    </div>
  );
}

export default ViewRegistration;
